import React, { useEffect } from "react";
import LoginForm from "../components/smart/LoginForm";
import Link from "next/link";
import { SignUpFacebook, SignUpGoogle } from "../components/dumb/SignUpVia";
import MainPage from "../components/dumb/MainPage";
import { Auth } from "../customHooks/authMiddleware";
import Layout from "../components/layout";

const Page = () => {
    Auth(false);
    return (
        <Layout title="Welcome!">
            <header>
                <h1>Witaj!</h1>
                <br />
                <h4>Aby rozpocząć zaloguj się na swoje konto!</h4>
            </header>
            <LoginForm />
            <p className="p">
                Nie masz konta?
                <Link href="/register">
                    <a>ZAREJESTRUJ SIĘ!</a>
                </Link>
            </p>
            <p className="p">
                <Link href="/recoverpassword">
                    <a>Nie pamiętasz hasła?</a>
                </Link>
            </p>
            <SignUpGoogle />
            <SignUpFacebook />
        </Layout>
    );
};

export default Page;
